  ["applications"] = "<html><body><h1>applications</h1><p>n the act of bringing something to bear; using it for a particular purpose<p></p>n a verbal or written request for assistance or employment or admission to a school<p></p>n the work of applying something; <p></p>n a program that gives a computer instructions that provide the user with tools to accomplish a task<p></p>n liquid preparation having a soothing or antiseptic or medicinal action when applied to the skin<p></p>n a diligent effort<p></p>n the action of putting something into operation</p><p>n. 应用；应用程序；应用软件（application的复数）</p></body></html>",
