  ["applier"] = "<html><body><h1>applier</h1><p>n a person who requests or seeks something such as assistance or employment or admission<p></p>n a device for applying a substance</p><p>n. 灌肠器, 填充器</p></body></html>",
  ["appliers"] = "<html><body><h1>appliers</h1><p>plural of applier<p></p>n a person who requests or seeks something such as assistance or employment or admission<p></p>n a device for applying a substance</p><p>(applier 的复数) n. 灌肠器, 填充器</p></body></html>",
  ["applies"] = "<html><body><h1>applies</h1><p>v put into service; make work or employ for a particular purpose or for its inherent or natural purpose<p></p>v be pertinent or relevant or applicable<p></p>v ask (for something)<p></p>v apply to a surface<p></p>v be applicable to; as to an analysis<p></p>v give or convey physically<p></p>v avail oneself to<p></p>v ensure observance of laws and rules; <p></p>v refer (a word or name) to a person or thing<p></p>v apply oneself to</p><p>v. 应用( apply的第三人称单数 ); [apply oneself]使（自己）致力于; [apply oneself]使从事于; 使接触</p></body></html>",
  ["appliest"] = "<html><body><h1>appliest</h1><p>vt.<p></p>涂(漆);敷(药);施;搽用;把…施用(或应用)于;撒;to apply a salve to the skin 将药膏敷在皮肤上 to apply paint to a wall把墙涂上漆<p></p>应用，充用：<p></p>to apply one's knowledge to a problem<p></p>把知识应用于解决问题<p></p>to apply a theory to a problem<p></p>应用原理解决问题<p></p>运用，使用：<p></p>to apply pressure to open the door<p></p>运用压力开门<p></p>实施，实行：<p></p>The club applied the rules to new members only.<p></p>俱乐部仅对新会员实行这些规定。<p></p>使用，利用：<p></p>She applied the brakes and kidded to a stop.<p></p>他使用刹车，车子滑行了一点距离后就停住了。<p></p>[apply oneself]使从事于，使忙于；使行动起来，使开始工作(to)：<p></p>He applied himself to his new duties with great energy.<p></p>他以极大的热情投入到新的工作中去。<p></p>[apply oneself]使(自己)致力于；使(注意力、精力等)专注于，使专心致志，使聚精会神；用功(to):<p></p>to apply oneself to one's work<p></p>致力于自己的工作<p></p>to apply one's mind to the problem<p></p>专心致志考虑如何解决问题<p></p>to apply oneself to a task<p></p>致力于完成任务<p></p>指定把…用于，把…用于某种特定目的(to):<p></p>She applied a portion of her salary each month to savings.<p></p>她每月把一部分薪金用于储蓄。<p></p>把…记入贷方：<p></p>to apply$ 50 to his account at the store<p></p>在商店中他的账户贷方记上50美元<p></p>(在称呼人或物时)用上(字眼)(to):<p></p>Don't apply any such term to me.<p></p>不要用这样的词语称呼我。<p></p>使接触，使靠近；用(火)点(灯等)：<p></p>to apply a match to gun powder<p></p>用火柴点燃炸药<p></p>把…置于他物之上；叠置于：<p></p>to apply one triangle upon another<p></p>将一个三角形叠置在另一个之上。<p></p>vi.<p></p>(尤指以书面形式)申请;请求(to someone for something):<p></p>to apply for a job<p></p>求职<p></p>to apply for a raise<p></p>申请提升<p></p>We applied to the authorities for assistance.<p></p>我们向当局求援。<p></p>适用，适合；应用：<p></p>The theory doesn't apply.<p></p>这理论不适用。<p></p>The argument applies to the case.<p></p>这理由适用于这种情况。<p></p>This principle always applies.<p></p>这项原则始终适用。<p></p>专心致志；努力：<p></p>The more you apply the better you will work.<p></p>你越专心致志，就工作得越好。<p></p>涉及，有关系：<p></p>That applies to you as much as to them.<p></p>那对你们和对他们同样有关系。<p></p>找…联系，接洽：<p></p>Job seekers should apply at the personnel office.<p></p>求职者可找人事部门办公室联系。<p></p>You may apply in person or by letter.<p></p>你可面谈或通过信件联系。<p></p>涂上；敷上；搽：<p></p>The plastic coating is easy to apply on any surface.<p></p>塑性涂料容易涂在任何表面上。<p></p>被置于或仍留在：<p></p>This paint doesn't apply very easily.<p></p>这种漆不很容易涂上。<p></p>变形：<p></p>vt.<p></p>applied<p></p>. applying</p></body></html>",
