  ["asslike"] = "<html><body><h1>asslike</h1><p>asslike<p></p>adj.<p></p>ass1的变形<p></p>ass1<p></p>[æs]<p></p>n.<p></p>【动物】驴(Equus)[如非洲普通野驴(Equus asinus)]<p></p>[贬义]蠢人，傻子，笨蛋；固执的人，家伙<p></p>vi.<p></p>胡闹<p></p>[俚语]胡乱拨弄(about):<p></p>Don't ass about with the computer.<p></p>别瞎拨弄这台电脑。<p></p>[俚语]鬼混,游荡(about,around):<p></p>to ass about the city<p></p>在城里到处游荡<p></p>短语:<p></p>act the ass<p></p>做糊涂事；出洋相；胡闹<p></p>All asses wag their ears.<p></p>[谚语]驴子扇耳朵，无知装聪明。<p></p>an ass between two bundles of hay<p></p>优柔寡断的人<p></p>an ass in a lion's skin<p></p>说大话的胆小鬼，色厉内荏的人<p></p>an ass with two panniers<p></p>[戏谑语]两臂各挽一女人招摇过市(或在街上行走)的男人<p></p>Asses carry the oats and horses eat them.<p></p>[谚语]驴驮燕麦马儿吃。(意为蠢人出力聪明人得利)<p></p>ass in grain<p></p>十足的大傻瓜<p></p>be an ass (或a fool)for one's pains<p></p>费力不讨好；自讨苦吃，自找麻烦<p></p>make an ass of oneself<p></p>当傻瓜，做傻事，做蠢事，愚弄；闹笑话，出洋相<p></p>make an ass of someone<p></p>[口语]愚弄某人，捉弄某人；使某人出洋相；使某人显得荒谬可笑<p></p>not within an ass's roar of<p></p>[爱尔兰口语]力所不能及的；无法达到的；无法理解的<p></p>play the ass<p></p>=<p></p>act the ass<p></p>sell your ass<p></p>[口语]不要这样呆头呆脑，不要这么蠢<p></p>The ass loaded with books is still an ass.<p></p>[谚语]驮书的驴还是驴。<p></p>The ass waggeth his ears.<p></p>[谚语]驴子摇耳朵，傻瓜装聪明。<p></p>till the ass ascends the ladder<p></p>决不能，永不能，绝对办不到；要等到驴年马月</p></body></html>",
