  ["assumers"] = "<html><body><h1>assumers</h1><p>assumer<p></p>n.<p></p>assume的变形<p></p>assume<p></p>[ə'sju:m; ə'su:m]<p></p>vt.<p></p>呈现，呈(某种形式、面貌等)；具有(…的作用、特征、性质等)；采取：<p></p>The situation assumed a threatening character.<p></p>形势显得很险恶。<p></p>The problem has assumed a new form.<p></p>这问题以新的方式出现了。<p></p>采用(某种方式等)：<p></p>They assumed the customs of their new country.<p></p>他们采用他们新来到国家的习俗。<p></p>He assumed the style of an aggressive go-getter.<p></p>他具有一个积极进取的、有冲劲和进取心的人的风度。<p></p>僭取；篡夺；夺取；擅用；侵占：<p></p>to assume the right to oneself<p></p>夺(或僭)取权利<p></p>承担；接受；接管；<p></p>to assume an obligationf<p></p>承担义务<p></p>担任；就任，就(职)：<p></p>to assume the office of treasurer<p></p>任司库职<p></p>to assume office<p></p>就职<p></p>假定，假设；臆断，想当然地认为：<p></p>to assume that everyone wants peace<p></p>假设每人都要和平<p></p>to assume a principle in reasoning<p></p>在推理中假定一个原理是正确的<p></p>Everyone assumed him to be dead.<p></p>大家都以为他不在人世了。<p></p>装出，假装，佯作，装作有(或是)：<p></p>to assume an air of innocence<p></p>装出一副无辜的样子<p></p>to assume a humble manner<p></p>装出一种谦卑的态度<p></p>穿上，戴上：<p></p>to assume a coat<p></p>穿上上衣<p></p>继承(他人)的债务(或义务)<p></p>(上帝)接…(进天国)<p></p>[古语]<p></p>接纳，接受，接收；雇用<p></p>收养<p></p>vi.<p></p>僭越<p></p>装腔作势<p></p>设想；想当然；相信<p></p>近义词:<p></p>pretend<p></p>. feign<p></p>. affect<p></p>. simulate<p></p>变形：<p></p>vt.<p></p>assumed<p></p>. assuming</p></body></html>",
