  ["attacher"] = "<html><body><h1>attacher</h1><p>attach（从属, 附属）的变形</p></body></html>",
  ["attachers"] = "<html><body><h1>attachers</h1><p>attacher<p></p>n.<p></p>attach的变形<p></p>attach<p></p>[ə'tætʃ]<p></p>vt.<p></p>结，采；贴；缚，拴，扎牢；装；连接 (to)：<p></p>Attach the handle to the box.<p></p>把把手安装于箱子上。<p></p>She attached labels to all her bags.<p></p>她把标签系(或贴)在所有袋子上。<p></p>to attach a photograph to an application with a staple<p></p>用订书钉把相片钉在一份申请表上。<p></p>[attach oneself ] 依附；加入，参加(党派、团体等)，作…的成员，使成为一分子；使在一起(to)：<p></p>She attached herself to us.<p></p>她和我们作伴。<p></p>to attach oneself to a group<p></p>参加一团体<p></p>You always attach yourself to people who end up hurting you.<p></p>你总是与那些最后会加害你的人结交。<p></p>使喜爱；使爱慕，使依恋(to)：<p></p>Jack is very much attached to the little boy.<p></p>杰克很喜欢这个小男孩。<p></p>添加，附加(条件等)(to)：<p></p>One proviso<p></p>is attached to this legacy.<p></p>这个遗赠附带一项限制性条款。<p></p>使附属，隶属，属于，使成为一部分；加(用法说明、附录、补遗等)(to)：<p></p>an appendix attached to the dictionary<p></p>词典的附录<p></p>把…归因于，把(过错的责任等)归于(to)：<p></p>A great deal of blame attaches to the officer for his recent action.<p></p>这名官员最近的行动受到许多指责。<p></p>认为有(重要性等)：<p></p>I attach great significance to the news.<p></p>我认为这消息具有重大意义。<p></p>to attach significance to a gesture<p></p>认为这个姿态很重要<p></p>(正式)任命，委派，委任，指派；[常用被动语态]把(某人临时或永久地)调至(to)：<p></p>His new firm attached him to the sales division of the business.<p></p>他的新公司派他到营业部工作。<p></p>签(名)，签署(名字等)(to)：<p></p>The officer attached his signature to the document.<p></p>这名官员在这份文件上签了名。<p></p>[attach itself]使附着;使依附(to)：<p></p>to attach itself to ships<p></p>附着于船上<p></p>【法律】逮捕，拘留(债务人)；查封，扣押(财产等)<p></p>【军事】把(部队的某小队或分队、人员等)配属(其他部队)(to)：<p></p>Our regiment is attached to the first division.<p></p>我们团配属第一师。<p></p>[废语]进攻，袭击<p></p>vi.<p></p>从属，附属；附着，附加，归属(to)：<p></p>One proviso attaches to the legacy.<p></p>这个遗赠附带一项限制性条款。<p></p>伴随而来；联在一起(to， upon)：<p></p>No blame attaches to her.<p></p>她无可指责。<p></p>近义词:<p></p>ascribe<p></p>. tie<p></p>短语:<p></p>attached please find<p></p>附上…请查收[书信用语]<p></p>be (或 become, etc.) attached to<p></p>(变得)喜欢，喜爱，爱慕，依恋，对…有感情<p></p>隶属于；附属于</p></body></html>",
  ["attaches"] = "<html><body><h1>attaches</h1><p>n a specialist assigned to the staff of a diplomatic mission<p></p>n a shallow and rectangular briefcase<p></p>v cause to be attached<p></p>v be attached; be in contact with<p></p>v become attached<p></p>v create social or emotional ties<p></p>v take temporary possession of as a security, by legal authority</p><p>v. 贴上, 系, 附上( attach的第三人称单数 ); （有时不受欢迎或未受邀请而）参加; 把…固定; 把…归因于</p></body></html>",
  ["attaching"] = "<html><body><h1>attaching</h1><p>v cause to be attached<p></p>v be attached; be in contact with<p></p>v become attached<p></p>v create social or emotional ties<p></p>v take temporary possession of as a security, by legal authority</p><p>[计] 归属<p></p>[经] 扣押, 查封</p></body></html>",
